import './App.css';

function App() {
  return (
    <div className="corpo">
      <header className="Calculadora-header">
        <p>
          Calcule seu IMC
        </p>
      </header>
      <div className="Calculadora">
      <form id="formulario">
      <input type="text" id="altura"></input>
      <input type="text" id="peso"></input>
      <input type="submit" value="Enviar"></input>
      </form> 
      </div>
    </div>
  );
}

export default App;
